import Link from  'next/link'
import {navbarLinks as link } from '../../NavigationMenu'




const Nav = (props) => {
    return (
        <nav className="flex justify-between items-center w-full h-[5em]  text-block relative  font-mono navbar">
           <div className="logo">
             <h2 className="text-2xl">ğ–’ğ–”ğ–ğ–ğ–Šğ–šğ–˜</h2>
           </div>

               <div className="space-x-4 flex mr-[4px]">
               {link.map((nav) => {
                    const { id, text, path } = nav;
                    return (

                        <Link as={`/dashboard/${nav.path}`} href='/dashboard/[pages]'>

                            <a>{text}</a>
                        </Link>

                    )
                })}
               </div>

        </nav>
    )
}


export default Nav
